Vi har at 1 minutt = 60 sekunder, og 1 fod = 0,3048 meter. Cyklen kører med 20 fod per minutt, dvs. 20 fod/1 minutt. Herved kan vi bruge konverteringene ovenfor, og at 1 minutt = 60 sekunder, for at have cyklenens hastighed i meter per sekund: $20\frac{\text{fod}}{\text{minutt}}\cdot \frac{0.3048\text{ m}}{1\text{ fod}}\cdot \frac{1\text{ minutt}}{60\text{ s}}=\frac{20\cdot 0.3048}{60}\frac{\text{m}}{\text{s}}=0.1016\frac{\text{m}}{\text{s}}$. Herved kan vi bruge konverteringene ovenfor, og at 1 minutt = 60 sekunder, for at have cyklenens hastighed i meter per sekund: $20\frac{\text{fod}}{\text{minutt}}\cdot \frac{0.3048\text{ m}}{1\text{ fod}}\cdot \frac{1\text{ minutt}}{60\text{ s}}=\frac{20\cdot 0.3048}{60}\frac{\text{m}}{\text{s}}=0.1016\frac{\text{m}}{\text{s}}$. Svar: Cyklen kører med en hastighet på $\boxed{0.1016\frac{\text{m}}{\text{s}}}$.

